from typing import List


class Solution:
    def maxOperations(self, s: str) -> int:

        ans = 0
        ones = 0
        zeroused = False
        for i in s:
            if i=='1':
                ones+=1
                zeroused = False
            else:
                if zeroused == False:
                    ans+=ones
                    zeroused = True
        return ans
